import React from 'react';

function Footer() {
    return (
        <footer>
            <h3>by <a href="https://www.linkedin.com/in/simone-moschetta-a03b1588/" target="_blank" rel="noopener noreferrer">Simone Moschetta</a></h3>
        </footer>
    );
}

export default Footer;
